DROP TABLE IF EXISTS `pvp_item`;

CREATE TABLE `pvp_item` (
  `ID` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `ItemID` int(11) NOT NULL DEFAULT '0',
  `ILvl` int(11) NOT NULL DEFAULT '0',
  `BuildVerified` int(10) unsigned NOT NULL,
  PRIMARY KEY (`ID`)
) ENGINE=MyISAM AUTO_INCREMENT=45662 DEFAULT CHARSET=utf8;

